import React from 'react';
import axios from 'axios';

class App extends React.Component {

  state = {
    pools : [],
  }

  componentDidMount() {

    let data;

    axios.get('http://localhost:8000/dropshipping/product-pool')
    .then(res => {
      data = res.data;
      this.setState({
        pools : data  
      });
    })
    .catch(err => {})
  }

render() {
  return(
    <div>
        {this.state.pools.map((pools, id) => (
        <div key={id}>
        <div>
          <div>
              <h1>{pools.pool_type}</h1>
              <footer >
                <cite title="Source Title">
                  {pools.pool_type}
                </cite>
              </footer>
          </div>
        </div>
        </div>
        )
      )}
    </div>
  );
}
}

export default App;
